import React, { useState, useEffect, useRef } from 'react';

function HeaderWithSidebar() {
  const [isSidebarOpen, setSidebarOpen] = useState(false);
  const sidebarRef = useRef(null);
  const buttonRef = useRef(null);

  const toggleSidebar = () => {
    setSidebarOpen(!isSidebarOpen);
  };

  const handleClickOutside = (e) => {
    if (
      sidebarRef.current && !sidebarRef.current.contains(e.target) &&
      buttonRef.current && !buttonRef.current.contains(e.target)
    ) {
      setSidebarOpen(false); // Close sidebar if click is outside
    }
  };

  // Add event listener for click outside
  useEffect(() => {
    document.addEventListener('mousedown', handleClickOutside);

    // Cleanup event listener on component unmount
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  return (
    <>
      <div className="navbar">
        <button
          ref={buttonRef}
          className="sidebar_button"
          onClick={toggleSidebar}
          aria-label="Toggle Sidebar"
        >
          â˜°
        </button>
        <a href="#" className="sooperstudieslink">SooperStudies</a>
        <div className="nav-center">
          <div className="dropdown">
            <span className="headings resources">Resources</span>
            <div className="dropdown-content">
              <a href="#">E-books</a>
              <a href="#">PESU</a>
              <a href="#">Wikipedia</a>
              <a href="#">Summaries</a>
              <a href="#">Videos</a>
            </div>
          </div>
          <div className="dropdown">
            <span className="headings community">Community</span>
            <div className="dropdown-content">
              <a href="#">Forums</a>
              <a href="#">Events</a>
              <a href="#">Discussions</a>
            </div>
          </div>
          <div class="dropdown">
            <span class="headings accessibility">Accessibility</span>
            <div class="dropdown-content">
                <a href="#">Text-to-Speech</a>
                <a href="#">Screen Readers</a>
                <a href="#">High Contrast</a>
                <a href="#">Bookmarks</a>
            </div>
        </div>
        <div class="dropdown">
            <span class="headings study">Techniques</span>
            <div class="dropdown-content">
                <a href="#">Pomodoro</a>
                <a href="#">Flashcards</a>
                <a href="#">Mind Maps</a>
            </div>
        </div>
        <div class="dropdown">
            <span class="headings game">Game</span>
            <div class="dropdown-content">
                <a href="#">Quizzes</a>
                <a href="#">Memory Games</a>
                <a href="#">Puzzles</a>
                <a href="#">Achivements</a>
                <a href="#">Rewards</a>
            </div>
        </div>
        </div>
        <div className="search">
          <input type="text" placeholder="Search..." />
        </div>
      </div>

      <div
        ref={sidebarRef}
        className={`sidebar-container ${isSidebarOpen ? 'open' : 'closed'}`}
      >
        <div className="sidebar_content">
          <ul className="sidebar_list">
            <li className="sidebar_item">Home</li>
            <li className="sidebar_item">About Us</li>
            <li className="sidebar_item">Contact Us</li>
            <li className="sidebar_item">Log Out</li>
            <li className="sidebar_item">Help</li>
          </ul>
        </div>
      </div>
    </>
  );
}

export default HeaderWithSidebar;
